import React, { Component }from 'react';
import 'tachyons';

class Register extends Component {
    render(){
        return(
            <div>
                <form>
                    <fieldset>
                        <legend>Register</legend>
                    </fieldset>       
                </form>
            </div>
        )
    }
}

export default Register;
